values:
OMG Dino's new seiyuu is KENN!!! 

I really wish that there's a Reborn musical now.

EDIT: I like KENN, really. But I don't like his Dino's voice at all. ;;

DGM 177:&nbsp;Ticky is no long a Noah... ;_;

And it's kinda sad that the first thought I had when I saw Allen's new sword is that it would cost even more to cosplay Allen now. it would take at least $500 to make that sword.&nbsp;D:&nbsp;

And I've similar thought when I see Gokudera's skull. One of the things I like about cosplaying Reborn characters is that their weapons are easy to make, but now there's no way&nbsp;that I can make that skull myself and it probably wouldn't be cheap to make it. DDDDD:

Reborn! Target 139:
I guess that every manga in Jump need to have at least one naked female scene.
But. OMG. Future Yamamoto &hearts;
